import React from "react";

const firstName = "Bob",
  lastName = "Seiger";
// Content component
const Content = () => (
  <div>
    <main>Content</main>
    // using string templating from es6
    <p>Hello, {`${firstName} ${lastName}`}</p>
  </div>
);

export default Content;
